INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'modules/account/const/account', 'groep-cp--omschrijving', '<p>Als beheerder kan je de toegangsaanvragen voor je organisatie verwerken, heb je een overzicht van de actieve bezoekers en de materiaalaanvragen en kan je de instellingen van de bezoekertool voor jouw organisatie beheren.</p><p><a href="https://support.meemoo.be/hc/nl/articles/7060114803473" target="_blank">Lees hier meer over het beheer van de bezoekertool &gt;</a></p><p></p>', 'HTML', 'nl') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Als beheerder kan je de toegangsaanvragen voor je organisatie verwerken, heb je een overzicht van de actieve bezoekers en de materiaalaanvragen en kan je de instellingen van de bezoekertool voor jouw organisatie beheren.</p><p><a href="https://support.meemoo.be/hc/nl/articles/7060114803473" target="_blank">Lees hier meer over het beheer van de bezoekertool &gt;</a></p><p></p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'modules/account/const/account', 'groep-cp--omschrijving', '<p>As administrator, you can process access requests for your organisation, have an overview of active visitors and material requests, and manage the settings of the visitor space for your organisation.</p><p><a href="https://support.meemoo.be/hc/nl/articles/7060114803473-Wat-houdt-mijn-rol-als-beheerder-van-de-bezoekertool-in" target="_blank">More on managing the visitor space (Dutch) &gt;</a></p>', 'HTML', 'en') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>As administrator, you can process access requests for your organisation, have an overview of active visitors and material requests, and manage the settings of the visitor space for your organisation.</p><p><a href="https://support.meemoo.be/hc/nl/articles/7060114803473-Wat-houdt-mijn-rol-als-beheerder-van-de-bezoekertool-in" target="_blank">More on managing the visitor space (Dutch) &gt;</a></p>', value_type = 'HTML';
