INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'modules/visitor-space/components/visitor-space-search-page/visitor-space-search-page', 'pages-bezoekersruimte-zoeken-zoek-info', '<p>Je zoekresultaten zijn afhankelijk van alle ingegeven trefwoorden en ingestelde filters.<br/></p><p>Zoeken op een exacte woordcombinatie kan door dubbele aanhalingstekens te gebruiken.<br/></p><p>Je kan trefwoorden combineren aan de hand van AND, OR en NOT<br/></p><p><a href="https://hetarchief.be/zoeken-op-hetarchief-be" target="_blank">Meer zoektips vind je hier &gt;</a></p>', 'HTML', 'nl') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Je zoekresultaten zijn afhankelijk van alle ingegeven trefwoorden en ingestelde filters.<br/></p><p>Zoeken op een exacte woordcombinatie kan door dubbele aanhalingstekens te gebruiken.<br/></p><p>Je kan trefwoorden combineren aan de hand van AND, OR en NOT<br/></p><p><a href="https://hetarchief.be/zoeken-op-hetarchief-be" target="_blank">Meer zoektips vind je hier &gt;</a></p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'modules/visitor-space/components/visitor-space-search-page/visitor-space-search-page', 'pages-bezoekersruimte-zoeken-zoek-info', '<p>Your search results are attained through a combination of all entered keywords and set filters.</p><p>Search for an exact word combination by using double quotation marks.</p><p>You can combine keywords according to AND, OR, and NOT</p><p><a href="https://hetarchief.be/en/searching-on-thearchives-be" target="_blank">Find more search tips here &gt;</a></p>', 'HTML', 'en') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Your search results are attained through a combination of all entered keywords and set filters.</p><p>Search for an exact word combination by using double quotation marks.</p><p>You can combine keywords according to AND, OR, and NOT</p><p><a href="https://hetarchief.be/en/searching-on-thearchives-be" target="_blank">Find more search tips here &gt;</a></p>', value_type = 'HTML';
