INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'alert-message', '<p>Hetarchief.be is een initiatief van meemoo. Je kan met jouw account inloggen op meerdere applicaties van meemoo. Wijzigingen aan je gegevens worden dus overal doorgevoerd.</p><p></p><p>Wil je graag je e-mailadres wijzigen? Neem dan contact op via de Feedback-knop, onderaan deze pagina.</p>', 'HTML', 'nl') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Hetarchief.be is een initiatief van meemoo. Je kan met jouw account inloggen op meerdere applicaties van meemoo. Wijzigingen aan je gegevens worden dus overal doorgevoerd.</p><p></p><p>Wil je graag je e-mailadres wijzigen? Neem dan contact op via de Feedback-knop, onderaan deze pagina.</p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/account/mijn-profiel/index', 'alert-message', '<p>Thearchives.be is an initiative of meemoo. You can log in to multiple meemoo applications with your account. Changes to your data are therefore implemented everywhere.</p><p></p><p>Would you like to change your email address? Please contact us via the Feedback button at the bottom of this page.</p>', 'HTML', 'en') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Thearchives.be is an initiative of meemoo. You can log in to multiple meemoo applications with your account. Changes to your data are therefore implemented everywhere.</p><p></p><p>Would you like to change your email address? Please contact us via the Feedback button at the bottom of this page.</p>', value_type = 'HTML';
