INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/beheer/instellingen/index', 'als-bezoekers-een-aanvraag-doen-kunnen-zij-een-klein-tekstje-lezen-met-extra-info-over-het-bezoek-bv-vraag-meer-info-aan-balie-2-bij-aankomst-of-elke-dag-geopend-van-10-00-tot-17-00', 'Provide extra information about the visit here. When visitors make a request, they will see for example ''Ask more information at counter 2 upon arrival.'' or ''Open every day from 10:00 to 17:00.', 'HTML', 'en') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'Provide extra information about the visit here. When visitors make a request, they will see for example ''Ask more information at counter 2 upon arrival.'' or ''Open every day from 10:00 to 17:00.', value_type = 'HTML';
