INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/beheer/instellingen/index', 'dit-is-de-wachtzaalomschrijving-die-bezoekers-kunnen-lezen-op-de-detailpagina-van-je-bezoekersruimte-leg-uit-waar-je-bezoekersruimte-om-gaat-welke-info-men-er-kan-vinden-vertel-de-bezoeker-over-je-collectie', '<p>Dit is de omschrijving die bezoekers kunnen lezen op de wachtpagina van je organisatie. Je kan er bijvoorbeeld kort uitleg geven over je collectie.</p><p></p><p>We raden je ook aan om je aanvragers hier wat info te geven over hoe lang het duurt om toegang te krijgen, over hoe ze verwittigd zullen worden wanneer hun aanvraag behandeld werd, of over waar ze terecht kunnen met vragen voor jouw organisatie.</p>', 'HTML', 'nl') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Dit is de omschrijving die bezoekers kunnen lezen op de wachtpagina van je organisatie. Je kan er bijvoorbeeld kort uitleg geven over je collectie.</p><p></p><p>We raden je ook aan om je aanvragers hier wat info te geven over hoe lang het duurt om toegang te krijgen, over hoe ze verwittigd zullen worden wanneer hun aanvraag behandeld werd, of over waar ze terecht kunnen met vragen voor jouw organisatie.</p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/beheer/instellingen/index', 'dit-is-de-wachtzaalomschrijving-die-bezoekers-kunnen-lezen-op-de-detailpagina-van-je-bezoekersruimte-leg-uit-waar-je-bezoekersruimte-om-gaat-welke-info-men-er-kan-vinden-vertel-de-bezoeker-over-je-collectie', '<p>This is the description that visitors can read after filling in the form to request access. You can for example give a brief explanation of your collection.</p><p></p><p>We also recommend giving applicants here some info on how long it takes to get access, when they&#x27;ll be notified when their request is being processed, or where they can turn with questions about your organisation.</p>', 'HTML', 'en') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>This is the description that visitors can read after filling in the form to request access. You can for example give a brief explanation of your collection.</p><p></p><p>We also recommend giving applicants here some info on how long it takes to get access, when they&#x27;ll be notified when their request is being processed, or where they can turn with questions about your organisation.</p>', value_type = 'HTML';
