INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/beheer/instellingen/index', 'personaliseer-hoe-jouw-bezoekersruimte-in-het-aanbod-mag-verschijnen-op-het-bezoekersruimtes-overzicht-naast-een-standaard-achtergrondkleur-kan-je-ook-een-thematische-achtergrond-afbeelding-instellen', 'Personaliseer hoe jouw organisatie in het aanbod mag verschijnen op de bezoekertool. Naast een standaard achtergrondkleur kan je ook een thematische achtergrondafbeelding instellen.', 'HTML', 'nl') ON CONFLICT (component, location, key, language) DO UPDATE SET value = 'Personaliseer hoe jouw organisatie in het aanbod mag verschijnen op de bezoekertool. Naast een standaard achtergrondkleur kan je ook een thematische achtergrondafbeelding instellen.', value_type = 'HTML';
