INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/nieuwsbrief/index', 'nieuwsbrief-omschrijving', 'I would like to receive a newsletter from archive.be at most 3 times a year with information about new possibilities on the platform and inspiration for my search for digital archival material. 
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/nieuwsbrief/index', 'nieuwsbrief-omschrijving', 'Ik wil graag maximaal 3 keer per jaar een nieuwsbrief ontvangen van hetarchief.be met informatie over nieuwe mogelijkheden op het platform en inspiratie voor mijn zoektocht naar digitaal archiefmateriaal.
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/nieuwsbrief/index', 'nieuwsbrief-schrijf-je-in-voor-onze-nieuwsbrief-omschrijving', '<p>I would like to receive a newsletter from archive.be at most 3 times a year with information about new possibilities on the platform and inspiration for my search for digital archival material. </p><p></p><p>I agree with the processing of my personal data in accordance with the <a href="https://meemoo.be/en/privacy-policy" target="_blank">privacy policy</a>.</p>', 'HTML', 'en') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>I would like to receive a newsletter from archive.be at most 3 times a year with information about new possibilities on the platform and inspiration for my search for digital archival material. </p><p></p><p>I agree with the processing of my personal data in accordance with the <a href="https://meemoo.be/en/privacy-policy" target="_blank">privacy policy</a>.</p>', value_type = 'HTML';
INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/nieuwsbrief/index', 'nieuwsbrief-schrijf-je-in-voor-onze-nieuwsbrief-omschrijving', '<p>Ik wil graag maximaal 3 keer per jaar een nieuwsbrief ontvangen van hetarchief.be met informatie over nieuwe mogelijkheden op het platform en inspiratie voor mijn zoektocht naar digitaal archiefmateriaal.</p><p></p><p>Ik stem in met de verwerking van mijn persoonsgegevens overeenkomstig het <a href="https://meemoo.be/nl/privacybeleid" target="_blank">privacybeleid</a>.</p>', 'HTML', 'nl') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Ik wil graag maximaal 3 keer per jaar een nieuwsbrief ontvangen van hetarchief.be met informatie over nieuwe mogelijkheden op het platform en inspiratie voor mijn zoektocht naar digitaal archiefmateriaal.</p><p></p><p>Ik stem in met de verwerking van mijn persoonsgegevens overeenkomstig het <a href="https://meemoo.be/nl/privacybeleid" target="_blank">privacybeleid</a>.</p>', value_type = 'HTML';
