INSERT INTO app.translations ("component", "location", "key", "value", "value_type", "language") VALUES ('FRONTEND', 'pages/slug/toegang-aangevraagd/index', 'je-kan-de-status-van-je-aanvraag-volgen-op-de-bezoekersruimtes-pagina-je-ontvangt-ook-meteen-een-e-mailmelding-als-je-aanvraag-behandeld-werd', '<p>Je kan de status van je aanvraag volgen op <a href="https://hetarchief.be/bezoek" target="">https://hetarchief.be/bezoek</a>. Je ontvangt een e-mailmelding als je aanvraag behandeld werd.</p>', 'HTML', 'nl') ON CONFLICT (component, location, key, language) DO UPDATE SET value = '<p>Je kan de status van je aanvraag volgen op <a href="https://hetarchief.be/bezoek" target="">https://hetarchief.be/bezoek</a>. Je ontvangt een e-mailmelding als je aanvraag behandeld werd.</p>', value_type = 'HTML';
